package com.hikootech.mqcash.po;import java.util.Date;/** * @ClassName SysAlarm * @Description TODO(告警Po) * @author HAI DA* @date 2016年3月2日 上午11:38:07 *  */public class SysAlarm implements java.io.Serializable {	private static final long serialVersionUID = -6339877155750837560L;	/** alarmId **/	private String alarmId;	/** 告警所属系统：0-秒趣分期 1-秒趣门户 2-秒趣核心 3-秒趣企信 4-秒趣后台 **/	private String alarmSystem;	/** 告警所属级别：0-低 1-中 2-高 **/	private String alarmLevel;	/** 告警通知类型：0-邮件通知 1-短信通知 2-邮件并且短信通知 **/	private String alarmNoticeType;	/** 告警内容 **/	private String alarmContent;	/** 邮件作用，0-用户征信报表，1-业务告警邮件 **/	private Integer emailType;	/** 状态：0-未通知 1-已通知 **/	private int sendStatus;	/**  **/	private Date sendTime;	/**  **/	private Date createTime;	public String getAlarmId() {		return alarmId;	}	public void setAlarmId(String alarmId) {		this.alarmId = alarmId;	}	public String getAlarmSystem() {		return alarmSystem;	}	public void setAlarmSystem(String alarmSystem) {		this.alarmSystem = alarmSystem;	}	public String getAlarmLevel() {		return alarmLevel;	}	public void setAlarmLevel(String alarmLevel) {		this.alarmLevel = alarmLevel;	}	public String getAlarmNoticeType() {		return alarmNoticeType;	}	public void setAlarmNoticeType(String alarmNoticeType) {		this.alarmNoticeType = alarmNoticeType;	}	public String getAlarmContent() {		return alarmContent;	}	public void setAlarmContent(String alarmContent) {		this.alarmContent = alarmContent;	}	public Integer getEmailType() {		return emailType;	}	public void setEmailType(Integer emailType) {		this.emailType = emailType;	}	public int getSendStatus() {		return sendStatus;	}	public void setSendStatus(int sendStatus) {		this.sendStatus = sendStatus;	}	public Date getSendTime() {		return sendTime;	}	public void setSendTime(Date sendTime) {		this.sendTime = sendTime;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}		}